INSERT INTO `cl_contracts` VALUES ('1', '1', '<!DOCTYPE html> \r\n            <html> \r\n            <head> \r\n                <meta charset=\\\'utf-8\\\'> \r\n                <meta name=\\\'viewport\\\' content=\\\'initial-scale=1.0, maximum-scale=1.0, user-scalable=no\\\'/> \r\n                <title></title> \r\n                <style> \r\n                    body, h1, h2, h3, h4, h5, h6, div, hr, p, blockquote, dl, dt, dd, ul, ol, li, pre, form, fieldset, legend, button, input, textarea, th, td { \r\n                        margin: 0; \r\n                        padding: 0 \r\n                    } \r\n             \r\n                    body, button, input, select, textarea { \r\n                        font: 12px/1.5 tahoma, arial, \\\'\\\'5b8b\\\'\\\'4f53 \r\n                    } \r\n             \r\n                    body { \r\n                        _overflow: auto; \r\n                        _height: 100%; \r\n                        margin: 0 auto; \r\n                        font-family: Arial, \\\'黑体\\\'; \r\n                    } \r\n             \r\n                    html { \r\n                        _overflow: hidden \r\n                    } \r\n             \r\n                    h1, h2, h3, h4, h5, h6 { \r\n                        font-size: 100% \r\n                    } \r\n             \r\n                    address, cite, dfn, em, var { \r\n                        font-style: normal \r\n                    } \r\n             \r\n                    code, kbd, pre, samp { \r\n                        font-family: courier new, courier, monospace \r\n                    } \r\n             \r\n                    small { \r\n                        font-size: 12px \r\n                    } \r\n             \r\n                    ul, ol, li, dl, dt, dd { \r\n                        list-style: none \r\n                    } \r\n             \r\n                    sup { \r\n                        vertical-align: text-top \r\n                    } \r\n             \r\n                    sub { \r\n                        vertical-align: text-bottom \r\n                    } \r\n             \r\n                    legend { \r\n                        color: #000 \r\n                    } \r\n             \r\n                    i { \r\n                        font-style: normal; \r\n                    } \r\n             \r\n                    img { \r\n                        border: 0; \r\n                        padding: 0; \r\n                        margin: 0; \r\n                    } \r\n             \r\n                    input, textarea { \r\n                        outline: none; \r\n                    } \r\n             \r\n                    button, input, select { \r\n                        font: 12px/1.5 tahoma, arial, sans-serif; \r\n                        vertical-align: middle; \r\n                        cursor: pointer \r\n                    } \r\n             \r\n                    table { \r\n                        border-collapse: collapse; \r\n                        border-spacing: 0 \r\n                    } \r\n             \r\n                    .clear { \r\n                        display: block; \r\n                        float: none; \r\n                        clear: both; \r\n                        overflow: hidden; \r\n                        visibility: hidden; \r\n                        width: 0; \r\n                        height: 0; \r\n                        background: none; \r\n                        border: 0; \r\n                        font-size: 0 \r\n                    } \r\n             \r\n                    textarea { \r\n                        resize: none; \r\n                        cursor: pointer \r\n                    } \r\n             \r\n                    /*a*/ \r\n                    a { \r\n                        text-decoration: none; \r\n                    } \r\n             \r\n                    input, textarea { \r\n                        outline: none; /*幹掉Chrome有焦點時顯示土黃框*/ \r\n                    } \r\n             \r\n                    h1 { \r\n                        font-size: 18px; \r\n                        line-height: 40px; \r\n                        text-align: center; \r\n                        color: #333; \r\n                    } \r\n             \r\n                    h2 { \r\n                        font-size: 16px; \r\n                        line-height: 40px; \r\n                        text-align: center; \r\n                        color: #333; \r\n                    } \r\n             \r\n                    .font01 { \r\n                        margin-right: 2%; \r\n                        text-align: right; \r\n                        overflow: hidden; \r\n                        font-size: 12px; \r\n                        color: #333; \r\n                        line-height: 30px; \r\n                    } \r\n             \r\n                    p { \r\n                        width: 96%; \r\n                        margin: 0 auto; \r\n                        line-height: 24px; \r\n                        font-size: 14px; \r\n                        color: #333; \r\n                        margin-bottom: 10px; \r\n                    } \r\n             \r\n                    i { \r\n                        width: 96%; \r\n                        margin-left: 2%; \r\n                        line-height: 20px; \r\n                        font-size: 14px; \r\n                        color: #333; \r\n                        margin-bottom: 10px; \r\n                        display: inline-block; \r\n                        font-style: normal; \r\n                        font-weight: bold; \r\n                    } \r\n             \r\n                    .border01 { \r\n                        width: 100px; \r\n                        height: 30px; \r\n                        line-height: 30px; \r\n                        border-bottom: 1px solid #000; \r\n                        display: block; \r\n                        float: right; \r\n                        text-align: center; \r\n                    } \r\n             \r\n                    .color01 { \r\n                        color: #000000; \r\n                    } \r\n             \r\n             \r\n                </style> \r\n             \r\n            </head> \r\n            <body> \r\n            <h1>玖易贷借款及服务协议</h1> \r\n            <div class=\\\'font01\\\'>协议编号：<span class=\\\'border01\\\'>{PROTOCOL}</span></div> \r\n            <h2>第一部分：借款、服务信息及相关明细</h2> \r\n            <p>[特别提醒]：在借款人确认同意本合同之前，借款人应事先了解本合同借款的全部内容，同意向杭州众惠金服科技有限公司申请借款。一旦借款人在<span class=\\\'color01\\\'>出借人及相关联网站及客户端</span>（以下简称“贷款平台”）点击接受本合同，即意味着借款人已阅读本合同所有条款，对并本合同条款的含义及相应的法律后果已全部通晓并充分理解，同意接受本合同约束。 \r\n            </p> \r\n            <p>【贷款基本信息】为保护借款人的信息，本合同在贷款平台展示时隐藏部分借款人的敏感信息（本合同对借款人敏感部分信息的隐藏不影响本合同的效力）。</p> \r\n            <p>借款人:<span>{fullname}</span></p> \r\n            <p>证件号码：<span>{id_card}</span></p> \r\n            <p>证件类型：<span>{id_type}</span></p> \r\n            <p>借款金额：<span> {amount}元（大写：{AMOUNT}园整）</span></p> \r\n            <p>借款期限：<span>{make_Loans_time_limit}</span></p> \r\n            <p>借款利率：<span>{make_Loans_day_rate}</span></p> \r\n            <p>借款平台服务费：<span>{make_Loans_service_cost}</span></p> \r\n            <p>借款贷后服务费：<span>{make_Loans_manage_cost}</span></p> \r\n            <p>收款账户：<span>{make_Loans_cardId}</span></p> \r\n            <p>还款方式：<span>{make_Loans_Payment_method}</span></p> \r\n            <p>合同签署日：<span>{date}</span></p> \r\n            <p>合同签订地：<span>浙江省杭州市余杭区</span></p> \r\n            <p class=\\\'color01\\\'>注：上述借款明细部分内容可能根据借款利率的调整而调整，如有变化，以本协议签订时的玖易贷网上发布或更新的具体内容为准。</p> \r\n            <h2>第二部分：本协议相关具体条款</h2> \r\n            <i>第1条名词定义</i> \r\n            <p>除非上下文另有解释，下列用语具有以下含义：</p> \r\n            <p>1.1&nbsp;&nbsp;本协议：指本《玖易贷借款协议》第一部分、第二部分及所有附件中的任何条款、 明细和信息；</p> \r\n            <p class=\\\'color01\\\'>1.2&nbsp;&nbsp;出借人：指本协议附件一中列明的出借人，为符合中华人民共和国法律（即中国法律，不包括香港特别行政区、澳门特别行政区和台湾地区的法律法规）规定的具有完全民事权利能力和民事行为能力，能独立行使和承担协议项下权利义务的自然 \r\n                人。出借人需为\\\'玖易贷\\\'的注册用户；</p> \r\n            <p>1.3&nbsp;&nbsp;借款人：指本协议第一部分中列明的借款人，为符合中国法律规定的具有完全民事权利能力和民事行为能力，能独立承担本协议项下权利义务的自然人。借款人需为 \\\'玖易贷\\\'的注册用户；</p> \r\n            <p>1.4&nbsp;&nbsp;众惠金服：指经营玖易贷平台的<span class=\\\'color01\\\'>杭州</span>众惠金服科技有限公司；</p> \r\n            <p>1.5&nbsp;&nbsp;玖易贷：是指众惠金服经营的提供专业信用借款服务的互联网平台；</p> \r\n            <p>1.6&nbsp;&nbsp;支付机构：指在本协议各方之间作为中介机构提供资金转移服务的银行或第三方支付结算机构； </p> \r\n            <p class=\\\'color01\\\'>1.7&nbsp;&nbsp;借款出借日期：出借人向借款人出借的资金通过支付机构划离出借人的出借资金存管账户之日。</p> \r\n            <i>第2条 借款人承诺及出借人的权利及义务</i> \r\n            <p>2.1&nbsp;&nbsp;借款人各自在此确认为具有完全民事权利能力和完全民事行为能力的自然人，有权签订并履行本协议。</p> \r\n            <p>2.2&nbsp;&nbsp;借款人已认真阅读和理解本协议所有内容并自愿按本协议相关约定履行相应的权利义务。</p> \r\n            <p>2.3&nbsp;&nbsp;借款人按本协议约定的借款明细及还款明细履行还款义务。</p> \r\n            <p>2.4&nbsp;&nbsp;借款人应妥善保管自己玖易贷网站的注册用户名和密码，自行承担因注册用户名和密 \r\n                码丟失、泄露或允许他人使用所产生的后果。任何一方使用借款人本人名义开户并设置了密码的借款人用以签约的账户在贷款平台所从事的所有行为均视为借款人本人行为，包括但不限于订立本合同、申请支用借款和归还借款等，该等行为的法律后果均由借款人本人承担。</p> \r\n            <p>2.5&nbsp;&nbsp;借款人承诺并保证其向众惠金服（玖易贷）提供的所有信息均为真实、准确、完整、合法和有效的，包括提供个人情况（包括但不限于姓名、身份证号、学历、联系方式、联系地址、职业 \r\n                信息、联系人信息等）、在所有网络借贷信息中介机构未偿还借款信息以及借款用途等相关信息。</p> \r\n            <p>2.6&nbsp;&nbsp;借款人保证自身具有与借款金额相匹配的还款能力并依照本协议约定履行还款义务。</p> \r\n            <p>2.7&nbsp;&nbsp;借款人承诺，不得利用玖易贷平台进行信用卡套现、房地产、洗钱或其他违法、违纪行为，否则应依法承担由此产生的法律责任与后果。</p> \r\n            <i>第3条 合同说明 </i> \r\n            <p>3.1&nbsp;&nbsp;借款人与贷款人一致同意以数据电文形式订立并认同其效力。</p> \r\n            <p>3.2&nbsp;&nbsp;借款人在贷款平台确认本合同后并不导致本合同立即生效，仅在经过贷款人或贷款平台审核通过并将贷款资金划入本合同第一条约定收款账户时，本合同开始生效。</p> \r\n            <p>3.3&nbsp;&nbsp;本协议项下的附件属于本协议不可分割的组成部分。本协议任何条款的标题仅系为方便援引和阅读而设置，不得被用于解释本协议任何条款的依据。</p> \r\n            <p>3.4&nbsp;&nbsp;本协议项下借款人还款日详见贷款平台显示。如还款当月无上述日期，则该月的最后一天为当月的还款日。如还款日为法定假日或公休日，还款日不顺延。</p> \r\n            <p>3.5&nbsp;&nbsp;本协议项下借款人在到期还款日前需一次性归还本金。</p> \r\n            <p>备注：</p> \r\n            <p>&nbsp;&nbsp;（1）借款本金指上述第一部分列明的借款本金；</p> \r\n            <p>&nbsp;&nbsp;（2）管理费及贷后服务费一次性扣除，实际放款金额为借款本金扣除第一部分列示相关费用；</p> \r\n            <p>3.6&nbsp;&nbsp;借款人成功获得借款后，到期还款日前需履行还款义务。借款人<span class=\\\'color01\\\'>除</span>主动发起还款外，同意授权贷款人和贷款平台，用自动扣款的方式，于到期还款日当天从绑定的银行卡中扣除应还款项。借款人应确保用户还款的绑定银行账户余额充足。借款人知晓并同意，根据系统或服务安排贷款人和贷款服务顾问有权在还款日当天（北京时间，下同）的任一时间点向借款人发起到期自动扣款，并不定期调整；且因存在分批次扣款，故每个借款人的被扣款时点可能不同。 \r\n                借款人知晓并同意，到期自动还款仅系贷款人和贷款平台为方便借款人还款而提供的一项服务，其可能受网络、系统、合作银行机构等各类因素的限制而导致还款失败。故借款人应密切注意还款提示和结果，若出现自动还款失败，应及时履行主动还款的义务。因延误或拒绝还款而导致的贷款逾期损失由借款人自行承担。 \r\n            </p> \r\n            <i>第4条 关于违约责任</i> \r\n            <p>4.1&nbsp;&nbsp;若借款人在玖易贷上显示的还款期限内未足额还款的，须按下面方式计算向玖易贷支付逾期违约金：逾期违约金=(月应还本息-实际已还本息）x逾期天数x0.005/天（逾期违约金系数）</p> \r\n            <p>4.2&nbsp;&nbsp;若借款人没有足额偿还借款本息的，所偿还之金额应按照<span class=\\\'color01\\\'>平台管理费</span>、违约金、利息、本金之顺序偿还。</p> \r\n            <p class=\\\'color01\\\'>4.3&nbsp;&nbsp;若借款人提供虚假资料或者故意隐瞒重要事实， 则出借人有权通过易玖贷提前终止本协议并要求借款人提前偿还本金，同时借款人须向出借人支付借款本金总额的违约金。</p> \r\n            <p class=\\\'color01\\\'>4.4&nbsp;&nbsp;借款人违反本协议之相关约定，或未经出借人同意，擅自转让本协议借款债务的，借款人应向出借人支付借款本金总额10%的违约金。</p> \r\n            <p class=\\\'color01\\\'>4.5&nbsp;&nbsp;借款人因违约而给出借人造成损失的，应承担赔偿责任。</p> \r\n            <p>4.6&nbsp;&nbsp;发生以下一项或几项情形时，均视为借款人违约：</p> \r\n            <p>&nbsp;&nbsp;（1）借款人违反其在本协议中所做的任何承诺或保证内容的；</p> \r\n            <p>&nbsp;&nbsp;（2）借款人的任何财产遭受没收、征用、查封、扣押、冻结等可能影响其履行能力的不利事件，且未及时对其他各方进行书面通知或不能及时提供有效补救措施的；</p> \r\n            <p>&nbsp;&nbsp;（3）借款人的财务状况出现实质性影响其履约能力的不利变化，且未及时对其他各方进行书面通知或不能及时采取有效补救措施的。</p> \r\n            <i class=\\\'color01\\\'>第5条 关于债权转让</i> \r\n            <p class=\\\'color01\\\'>5.1&nbsp;&nbsp;出借人依据玖易贷的规则和本协议约定将本协议项下的债权转让与第三人的，由出借人委托玖易贷通过公司邮箱向借款人注册时填写的注册邮箱发送债权转让通知书，该通知书到达借款人即视为通知已经送达。</p> \r\n            <p class=\\\'color01\\\'>5.2&nbsp;&nbsp;在出借人的债权转让后，借款人需对新债权人继续履行本协议下其对出借人的所有义务，不得以未接到债权转让通知为由拒绝履行还款义务。</p> \r\n            <i>第6条 关于法律适用及管辖</i> \r\n            <p>6.1&nbsp;&nbsp;适用法律。本协议的全部事项，包括但不限于本协议的效力、解释、履行以及争议 的解决均受中国法律管辖；本协议项下任一条款如与中国法律中的强制性规范相抵 \r\n                触，应在该等强制性规范所不禁止的最大限度内进行解释和执行，且任何该等与强 制性规范相抵触的约定不应影响本协议其他条款的效力。</p> \r\n            <p>6.2&nbsp;&nbsp;争议管辖。双方一致同意，如发生争议，不论争议金额大小，均提交杭州仲裁委员会适用杭州仲裁委员会仲裁规则项下的简易程序进行仲裁。</p> \r\n            <p>6.3&nbsp;&nbsp;在仲裁期间，本协议中不涉及争议的条款仍须履行，各方均不得以解决争议为由拒 不履行其在本协议项下的任何义务。</p> \r\n            <i>第7条 还款明细</i> \r\n            <p>{repayment_detail}</p> \r\n             \r\n             \r\n            </body> \r\n            </html>;', '2017-11-27 18:39:44', '1', '1', '1');
