-- ----------------------------
-- Table structure for `cl_bankaccount`
-- ----------------------------
DROP TABLE IF EXISTS `cl_bankaccount`;
CREATE TABLE `cl_bankaccount` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `Merchant_Order_Number` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '如为正交易则是商户系统发起正交易时的唯一订单号，如为退款交易则是商户发起退款时商户系统的唯一订单号；',
  `Merchant_ID` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '商户编号是商户在连连支付平台上开设的商户唯一编号，为 18 位数字，',
  `Time_of_Order_Created` datetime DEFAULT NULL COMMENT '订单创建时间是商户订单的创建时间；交易请求时的dt_order字段；',
  `Merchant_Business_Type` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '业务类型为虚拟商品销售（101001）或实物商品销售（109001），交易请求时的busi_partner字段；',
  `Lianlian_Payment_Number` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '连连支付系统唯一订单号，如为正交易，则是交易请求时连连支付返回的oid_paybill字段；如为退款交易，则是退款所关联的正交易的商户订单号；',
  `Lianlian_Settlement_Date` datetime DEFAULT NULL COMMENT '账务日期是该笔订单支付成功后返回的清算日期；',
  `Transaction_Amount` decimal(20,4) DEFAULT NULL COMMENT '订单金额，如为退款，则为该笔退款单的退款金额（退款则金额为负）；',
  `Type_Flag` int(2) DEFAULT NULL COMMENT '原单商户收付款标志，0为商户收款，1为商户付款',
  `Transaction_Status` int(2) DEFAULT NULL COMMENT '交易状态，0为正交易成功，5为退款，',
  `Update_Date` datetime DEFAULT NULL COMMENT '更新时间是该笔订单最终状态更新的时间，如为正交易，则是交易成功时间，如退款，则是退款成功时间。',
  `Service_Fee` decimal(20,6) DEFAULT NULL COMMENT '手续费是该笔订单连连支付应收手续费（退款则金额为负）；',
  `Payment_Product` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '商户使用的支付产品，WEB支付网关:WEB、手机应用支付网关:SDK、WAP支付网关:WAP、API接口:API、',
  `Payment_Method` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '商户使用的支付方式',
  `Order_Info` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '订单信息为交易请求时的info_order字段；',
  `Beneficiary_Bank` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '收款人银行：商户代付的对象的银行卡所属银行，如农业银行、工商银行等；',
  `Bank_Account_Number` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '收款人银行帐号：商户代付的对象的银行卡卡号，显示卡号最后4位；',
  `Beneficiary` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '收款人姓名，商户代付对象的姓名；',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of cl_bankaccount
-- ----------------------------

