  `name` varchar(255) NOT NULL COMMENT '产品名称',
  `alias` varchar(255) NOT NULL COMMENT '产品别名',
  `time_Limit` int(2) NOT NULL COMMENT '期限',
  `repayment_Type` int(2) NOT NULL COMMENT '还款类型,0为等额本息,扩展',
  `addtime` datetime DEFAULT NULL COMMENT '新增时间',
  `upptime` datetime DEFAULT NULL COMMENT '更新时间',
  `uppName` varchar(100) NOT NULL COMMENT '更新人',
  `version` varchar(255) NOT NULL COMMENT '版本号 V1',
  `costName` varchar(255) NOT NULL COMMENT '费用名称',
  `billing_Methods` int(2) NOT NULL DEFAULT '0' COMMENT '计费方式,0为百分比,扩展',
  `cost` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '费用值',
  `product_Rate` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '产品费率',
