  `order_number` varchar(255) NOT NULL COMMENT '申请编号订单号',
  `member_Id` bigint(20) NOT NULL COMMENT '申请人id指向cl_member 表主键',
  `order_create_time` datetime DEFAULT NULL COMMENT '申请时间',
  `goods_Id` bigint(20) DEFAULT NULL COMMENT '产品id 产品表',
  `daifu_id` bigint(20) NOT NULL COMMENT '代付表id',
  `order_code` varchar(255) DEFAULT NULL COMMENT '产品码,产品id+期限+还款方式',
  `order_amount` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '借款金额',
  `order_status` int(2) NOT NULL COMMENT '订单状态,0-未提交,1-已提交待审批,2-审批通过,3-审批拒绝,4-订单关闭,5待放款，6放款中,7已放款,8放款失败,9订单中止(一直没有放款结果的单子),10订单结清',
  `order_types` int(2) NOT NULL COMMENT '订单类型, 0为正常订单,1为逾期,2为用户删除订单',
  `order_auditor` varchar(20) NOT NULL COMMENT '审核人',
  `order_upptime` datetime DEFAULT NULL COMMENT '审核时间',
  `order_level` char(2) DEFAULT NULL COMMENT '审批等级',
  `order_verify_amount` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '审批金额',
  `order_channel` varchar(20) DEFAULT NULL COMMENT '渠道',
  `order_discount` bigint(20) DEFAULT NULL COMMENT '折扣id',
  `order_cardId` bigint(20) DEFAULT '1' COMMENT 'bankcard表Id',
  `order_amount_recognized` decimal(20,6) DEFAULT '0.000000' COMMENT '确认金额',
  `oid_paybill` varchar(20) DEFAULT NULL COMMENT '第三方数据',
  `order_repayment` decimal(20,6) DEFAULT '0.000000' COMMENT '已还款金额,不包含违约金--预留',
  `order_penalty` decimal(20,6) DEFAULT '0.000000' COMMENT '违约金 --预留',
  `order_fullName` varchar(30) DEFAULT NULL COMMENT '银行卡持有人姓名--预留',
  `order_next_Pay_Time` datetime DEFAULT NULL COMMENT '下次还款时间--预留',
  `order_overdue_Pay_Time` datetime DEFAULT NULL COMMENT '逾期时间--预留',
  `order_bad_Pay_Time` datetime DEFAULT NULL COMMENT '违约时间--预留',
  `order_audit_fail_msg` varchar(512) DEFAULT '' COMMENT '审核失败原因',
