-- ----------------------------
DROP TABLE IF EXISTS `cl_goods_repayment`;
CREATE TABLE `cl_goods_repayment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '借款编号Id主键',
  `order_Id` bigint(20) DEFAULT NULL COMMENT '订单表id',
  `repayment_times` int(4) NOT NULL COMMENT '期次',
  `repayment_amount` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还金额',
  `repayment_cost` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还费用',
  `repayment_capital` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还本金',
  `repayment_interest` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还利息',
  `repayment_default_interest` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还罚息',
  `repayment_manage_cost` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还管理费',
  `real_amount` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '实际还金额',
  `real_cost` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '实际还费用',
  `real_capital` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '实际还本金',
  `real_interest` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '实际还利息',
  `real_default_interest` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '实际还罚息',
  `real_manage_cost` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '实际还管理费',
  `repayment_status` int(2) NOT NULL COMMENT '状态,0正常还款,1提前还款,2逾期还款',
  `repayment_type` int(2) NOT NULL COMMENT '还款动作,0主动还款,1代扣,2催收还款',
  `repayment_cardId` bigint(20) DEFAULT NULL COMMENT '还款银行卡号',
  `repayment_time` datetime DEFAULT NULL COMMENT '还款时间',
  `repayment_number` varchar(255) DEFAULT NULL COMMENT '还款流水号',
