  `repayment_collection_amount` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还金额',
  `repayment_collection_capital` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还本金',
  `repayment_collection_interest` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '应还利息',
  `repayment_collection_add_time` datetime DEFAULT NULL COMMENT '入催时间',
  `repayment_collection_income` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '入催金额',
