-- ----------------------------
-- Table structure for `cl_member`
-- ----------------------------
DROP TABLE IF EXISTS `cl_member`;
CREATE TABLE `cl_member` (
  `uid` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键uid',
  `name` varchar(255) DEFAULT NULL COMMENT '用户名',
  `username` varchar(255) DEFAULT NULL COMMENT '用户账号 唯一键',
  `password` varchar(255) DEFAULT NULL COMMENT '用户密码',
  `salt` varchar(255) DEFAULT NULL COMMENT '盐',
  `state` tinyint(2) DEFAULT '1' COMMENT '状态  1正常 2黑名单',
  `authentication_status` int(2) DEFAULT '0' COMMENT '3、手机号未绑定 2、已认证1、银行卡未认证0、手机未认证 认证状态',
  `payment_password` varchar(255) DEFAULT NULL COMMENT '支付密码',
  `level_of_risk` char(2) DEFAULT NULL COMMENT '风险等级,风险等级表',
  `phone_number` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `addtime` datetime NOT NULL COMMENT '注册时间',
  `upptime` datetime DEFAULT NULL COMMENT '更新时间',
  `cost` decimal(20,4) DEFAULT '0.0300' COMMENT '付款后手续费',
  `head_icon` varchar(511) DEFAULT '' COMMENT '头像url',
  `wechat_openid` varchar(255) DEFAULT NULL COMMENT '微信openid',
  `wechat_nickname` varchar(255) DEFAULT NULL COMMENT '微信昵称',
  `wechat_headimgurl` text COMMENT '微信头像',
  `tb_data` longtext CHARACTER SET utf8mb4 COMMENT '淘宝数据 json格式存储',
  `jd_data` longtext COMMENT '京东数据 json格式存储',
  `Jxl_data` longtext COMMENT '聚信立接口采集运营商数据json',
  `bills_true_amount` decimal(20,6) DEFAULT '0.000000' COMMENT '出账金额',
  `bills_false_amount` decimal(20,6) DEFAULT '0.000000' COMMENT '未出账金额',
  `prepayment_amount` decimal(20,6) DEFAULT '0.000000' COMMENT '提前还款',
  `max_amount` decimal(20,6) DEFAULT '0.000000' COMMENT '最大可提现额',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=243 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of cl_member
-- ----------------------------

