  `agent_id` bigint(20) DEFAULT NULL COMMENT '代理人id 也是对应member表里面的一个用户',
  `agent_type` int(2) DEFAULT NULL COMMENT '代理等级 1一级代理 2二级代理 3三级代理 0—不是代理',
  `balance` decimal(20,4) DEFAULT NULL COMMENT '余额',
  `agent_score` decimal(20,2) DEFAULT NULL,
