  `commision_rate` decimal(20,6) DEFAULT NULL COMMENT '佣金比例',
  `referral_url` varchar(50) CHARACTER SET utf8 DEFAULT '' COMMENT '推广链接',
  `change_type` int(12) DEFAULT NULL COMMENT '提现类型 1：未申请 2：已申请 3：提现成功 4：已拒绝',
  `change_money` decimal(20,4) DEFAULT NULL COMMENT '提现金额',
  PRIMARY KEY (`id`)
