  `opening_Branch` varchar(255) DEFAULT NULL COMMENT '开户支行',
  `phoneNumber` varchar(20) DEFAULT NULL COMMENT '预留手机号码',
  `bank_card_validity` datetime DEFAULT NULL COMMENT '银行卡有效期',
  `auditor` varchar(20) DEFAULT NULL COMMENT '审核人',
