-- Table structure for billcollection
-- ----------------------------
DROP TABLE IF EXISTS `bill_collection`;
CREATE TABLE `bill_collection` (
  `billId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '账单id----账单的排期',
  `memberId` bigint(20) NOT NULL COMMENT '用户id',
  `status` varchar(255)  NOT NULL DEFAULT 'waiting' COMMENT '账单的状态，见BillStatus',
  `billNumber` varchar(255) DEFAULT NULL COMMENT '账单的流水号，例如20170330',
  `billDate` datetime NOT NULL  COMMENT '账单日',
  `dueDate` datetime NOT NULL  COMMENT '账单的到期时间',
  `overdueStatus` varchar(255)  NOT NULL DEFAULT 'no' COMMENT '逾期状态，见OverDueStatus',
