  `lastUpdatedDate` datetime  NOT NULL DEFAULT NOW(),
  PRIMARY KEY (`billId`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;


-- ----------------------------
-- Table structure for daifuorder
-- ----------------------------
DROP TABLE IF EXISTS `daifu_order`;
CREATE TABLE `daifu_order` (
  `orderId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '订单Id---订单的分期信息',
  `codeId` bigint(20) NOT NULL COMMENT 'daifu_code表的codeId',
  `billId` bigint(20) DEFAULT NULL COMMENT '账单id，可以是NULL',
  `memberId` bigint(20) NOT NULL COMMENT '用户id',
  `title` varchar(255) DEFAULT NULL COMMENT '订单的名称',
  `status` varchar(255) NOT NULL COMMENT '订单的状态,见OrderStatus',
  `totalTerm` bigint(20) NOT NULL COMMENT '期数',
  `price` decimal(20,6) NOT NULL DEFAULT '0' COMMENT '总本金',
  `commission` decimal(20,6) NOT NULL DEFAULT '0' COMMENT '手续费',
  `paidCommission` decimal(20,6) NOT NULL DEFAULT '0' COMMENT '实际支付的手续费',
  `monthlyFee` decimal(20,6) NOT NULL DEFAULT '0' COMMENT '每月管理费',
  `overdueStatus` varchar(255) NOT NULL DEFAULT 'no' COMMENT '逾期状态',
  `createdDate` datetime NOT NULL DEFAULT NOW(),
  `lastUpdateDate` datetime NOT NULL DEFAULT NOW(),
   `operatorId` varchar(255) DEFAULT NULL COMMENT '操作员id',
  `comments` varchar(1023) DEFAULT NULL COMMENT '操作说明',
  `downPayment` decimal(20,6) DEFAULT NULL COMMENT '首付',
  PRIMARY KEY (`orderId`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;


-- ----------------------------
-- Table structure for daifuorderleg
-- ----------------------------
DROP TABLE IF EXISTS `daifu_order_leg`;
CREATE TABLE `daifu_order_leg` (
  `orderlegId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '子订单',
  `orderId` bigint(20) NOT NULL COMMENT '订单id',
  `billId` bigint(20) DEFAULT NULL COMMENT '账单id',
  `amount` decimal(20,6) DEFAULT '0' COMMENT '应付金额',
   `memberId` bigint(20) NOT NULL COMMENT '用户id',
  `fee` decimal(20,6) NOT NULL DEFAULT '0' COMMENT '应付手续费',
  `interest` decimal(20,6) NOT NULL DEFAULT '0' COMMENT '应付罚息',
  `status` varchar(255) NOT NULL DEFAULT 'open' COMMENT '订单的状态,见OrderLegStatus',
  `overdueStatus` varchar(255)  NOT NULL DEFAULT 'no' COMMENT '逾期状态，见OverDueStatus',
  `createdDate` datetime NOT NULL DEFAULT NOW(),
  `lastUpdatedDate` datetime NOT NULL DEFAULT NOW(),
  `sequence` int(11) NOT NULL,
  PRIMARY KEY (`orderlegId`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;


-- ----------------------------
-- Table structure for repayment
-- ----------------------------
